import HeaderLeft from "./HeaderLeft";
import HeaderRight from "./HeaderRight";
export default function Header() {
  return (
    <>
      <header>
        <div className="header">
          <div className="full-header">
            <HeaderLeft />  
            <HeaderRight/> 
          </div>
        </div>
      </header>
    </>
  );
}
